		是否追踪 = false;
	}
}
追踪目标 = _parent.按距离索敌(索敌距离, 是否强行重新索敌, 优先索敌属性, 优先索敌排序);
if(!追踪目标){
	是否追踪 = false;
}
敌人顺序 = 0;


